import React from "react";

function Gif() {
  return (
    <div
      style={{
        width: "100%",
        height: 0,
        paddingBottom: "75%",
        position: "relative",
      }}
    >
      <iframe
        src="https://giphy.com/embed/ikXcqqlSNH2Mw"
        width="100%"
        height="100%"
        style={{ position: "absolute" }}
        frameBorder="0"
        className="giphy-embed"
        allowFullScreen
        title="Giphy Embed"
      ></iframe>
      <p>
        <a href="https://giphy.com/gifs/ikXcqqlSNH2Mw">via GIPHY</a>
      </p>
    </div>
  );
}

export default Gif;
